        <div class="about">
          
            <img src={back} alt="Logo"/>
         
          {/* <h2 class="title">CARE CLUB</h2> */}
          <p >
          How long has it been since you have eaten your last meal?
30 min?
1 hour?
2-3 hours?
Or maybe less than that.

          </p>
        </div>
        <div className="gallery" id="gallery"><h1>GALLERY</h1></div>
        <div className="feedback">
          <h1>Feedback</h1>
        </div>
      </div>
    </div>
  );
};

export default Home;
